script: |
  super -f text -I q11583.spq | sort > q11583.out

inputs:
  - name: q11583.spq
    data: |
      SELECT col0 * col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN - col1 * col2 AND ( NULL ) OR NOT - col0 = 75 + - col1 * 83;
  - name: tab1

outputs:
  - name: q11583.out
    data: |
      425
      4277
      714
